import React from 'react';
import data from './data';
import './App.css';

function Projects() {
  return(
    <div className="projects">
      <h2>Projects</h2>

      {data.projects.map(project => (
        <div className="project">
          <a href={project.link} target="_blank" rel="noopener noreferrer">
            <h3>{project.title}</h3>
          </a>
          ()
        </div>
      ))}
    </div>
  );
}

export default Projects;
